import React from 'react';
import ReactDOM from 'react-dom';

function App() {

    
    return (
        <div className='App'>
            <h2>Counter: </h2>
            <div>
                <button>Increase</button>
                <button>Decrease</button>
                <button>Reset</button>
            </div>
        </div>
    )
}
const app = (<App />)
ReactDOM.render(app, document.getElementById('root'));
